  \"wet-meadow-plant-associations-malheur-national-wildlife-refuge-harney-county-oregon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes vegetation data
  collected in July 2012 and July 2013 in wet meadow habitats on the Malheur National
  Wildlife Refuge. It incorporates portions of Christy (2013) that was based on field
  work completed in 2012, updated and expanded with new field data collected in 2013.
  Over the two year period, we sampled a total of 272 plots. Analysis of the data
  identified 19 plant associations: Alopecurus pratensis, Bromus inermis, Carex aquatilis
  var. aquatilis, Carex nebrascensis, Carex pellita, Carex praegracilis, Carex sheldonii,
  Distichlis spicata, Eleocharis palustris, Juncus balticus, Juncus nevadensis, Leymus
  triticoides, Muhlenbergia asperifolia, Persicaria lapathifolia, Phalaris arundinacea,
  Potenlilla rivalis, Schoenoplectus acutus, Sparganium (emersum, eurycarpum), and
  Typha latifolia. Plant associations spanned a wetland gradient from seasonally moist
  to seasonally or perennially flooded, but surface water had left most stands at
  time of sampling. Mean Wetland Indicator Status scores help to place the plant associations
  within gradients in soil moisture and alkalinity. The Alopecurus pratensis and Phalaris
  arundinacea associations are dominated by exotic, invasive species and appear to
  be outcompeting native plant associations. Phases of the Carex praegracilis association
  appear to be replaced by the Alopecurus pralensis association, while the Carex pellila,
  Juncus balticus, and Leymus triticoides associations may be replaced by the Phalaris
  arundinacea association.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
